import jsPDF from 'jspdf';

// ฐานข้อมูล base64 ฟอนต์ (อาจยาวมาก)
const SarabunNormalBase64 = `

`.trim(); // ✅ Base64 แบบย่อเพื่อแสดงตัวอย่าง

const SarabunBoldBae64 = `

`.trim(); 

const SarabunExtraBoldBae64 = `

`.trim(); 

export function registerTHSarabun(doc: jsPDF) { 
  // เพิ่มไฟล์ TTF ให้ VFS
  doc.addFileToVFS('Sarabun-Regular.ttf', SarabunNormalBase64);
  doc.addFileToVFS('Sarabun-Bold.ttf', SarabunBoldBae64);
  doc.addFileToVFS('Sarabun-ExtraBold.ttf', SarabunExtraBoldBae64);

  // เพิ่มฟอนต์แยก style
  doc.addFont('Sarabun-Regular.ttf', 'THSarabunNew', 'normal');
  doc.addFont('Sarabun-Regular.ttf', 'THSarabunNew', 'bold');
  doc.addFont('Sarabun-ExtraBold.ttf', 'THSarabunNew', 'extrabold');

  // ตั้งค่า default font
  doc.setFont('THSarabunNew', 'normal');
  doc.setFontSize(16);
}